import footerImg from "./Img/FooterPagePICountries.png";

function App() {
  return (
    <div className="App">
      <mainApp>
        <h1>Henry Countries</h1>
        <img src={footerImg} alt="monuments" />
      </mainApp>
    </div>
  );
}

export default App;

const mainApp = styled.section`
  img {
    width: 100%;
  }
`;
